import {CakeCard} from './Cake_card'

export function Cakelist(props){
    console.log(props)
var cake1={
    id:1,
    name:"Pound Cake",
    description:"	Sponge cake, cream, food colouring",
    image:"cake3.jpg"
  }
  var cake2={
    id:2,
    name:"Baked Flourless Cake",
    description:"Egg whites, vanilla, and cream of tartar",
    image:"cake1.jpg"
  }
  var cake3={
    id:3,
    name:"Chiffon Cake",
    description:"Apple, caramel icing",
    image:"cake3.jpg"
  }
    return(
        <>
<div className="container">
<div className="d-flex flex-fill flex-sm-wrap">
 <CakeCard data={cake1} history={props.history}/> 
 <CakeCard data={cake2}  history={props.history}/>
 <CakeCard data={cake3}  history={props.history}/>
</div>
</div>
        </>
    );
}
